const _hoisted_6 = /* @__PURE__ */ createStaticVNode('<h2 id="info" tabindex="-1"><a class="header-anchor" href="#info" aria-hidden="true">#</a> Info</h2><p><strong>Bio-Data</strong></p><ul><li>True Name: Meltryllis</li><li>Class: Alter Ego</li><li>Source: Fate/EXTRA CCC</li><li>Region: SE.RA.PH.</li><li>Gender: Female</li><li>Alignment: Lawful Good</li><li>Height: 190 cm</li><li>Weight: 33 kg</li></ul><p><strong>Meta</strong></p><ul><li>Character Creator: Nasu Kinoko</li><li>Character Illustrator: Wada Arco</li><li>Character Voice: Hayami Saori</li><li>Appearance in Main Works: Fate/EXTRA CCC</li></ul><h2 id="stats" tabindex="-1"><a class="header-anchor" href="#stats" aria-hidden="true">#</a> Stats</h2><table><thead><tr><th style="text-align:left;">Parameters</th><th style="text-align:center;">Values</th></tr></thead><tbody><tr><td style="text-align:left;">Strength</td><td style="text-align:center;">E</td></tr><tr><td style="text-align:left;">Constitution</td><td style="text-align:center;">C</td></tr><tr><td style="text-align:left;">Agility</td><td style="text-align:center;">A+</td></tr><tr><td style="text-align:left;">Magical Power</td><td style="text-align:center;">A</td></tr><tr><td style="text-align:left;">Luck</td><td style="text-align:center;">B</td></tr><tr><td style="text-align:left;">Noble Phantasm</td><td style="text-align:center;">EX</td></tr></tbody></table><h2 id="class-skills" tabindex="-1"><a class="header-anchor" href="#class-skills" aria-hidden="true">#</a> Class Skills</h2><p><strong>High Servant A</strong></p><p>Artificial Servant created by combining multiple mythological essences.</p><p>She possesses the components of Artemis, Leviathan and Saraswati.</p><p><strong>Riding B</strong></p><p>The ability to ride mounts.</p><p>As long as it is an animal that exists in reality, she can ride it, even if it is a wild one.</p><p><strong>Goddess&#39;s Divine Core B</strong></p><p>A Skill representing one as a perfect goddess from birth.</p><p>It has the effect of preserving the absolute nature of one&#39;s mind and body. Repels all forms of mental interference, prevents the body&#39;s growth and maintains one&#39;s figure no matter how much calories are ingested.</p><p><strong>Magic Resistance B</strong></p><p>Invalidates spells with a chant below three verses.</p><p>Even if one is targeted by High-Thaumaturgy and Greater Rituals, it is difficult for them to be wounded.</p><p><strong>Independent Action A</strong></p><p>The ability to act independently for a while even if the supply of mana from the Master is rejected.</p><p>An Alter Ego which exists as \u300Eanother aspect of an existence\u300F can act alone even without a Master. Meltryllis is more geared towards Independent Action, but this seems to be due to her heart which finds &quot;an \xE9toile (star) shining on the stage all by herself&quot; beautiful.</p><h2 id="personal-skills" tabindex="-1"><a class="header-anchor" href="#personal-skills" aria-hidden="true">#</a> Personal Skills</h2><p><strong>Crime Ballet A</strong></p><p>Merely a battle style.</p><p>A number of combat skills created as a result of Meltryllis, who adores classic ballet, retuning herself.</p><p>She came to possess diverse abilities by converting already perfected stories and settings into skills.</p><p>\u300EThe Name on the Heel is the Cursed Sword Giselle\u300F\u300EUnforgivable Hilarion\u300F\u300EFarewell Albrecht\u300F\u300EThe Siren Who Burns Entrails\u300Fand so on.</p><p>Originally, Meltryllis is an Alter Ego created from BB&#39;s &quot;Altruism Desire&quot; and &quot;Pleasure&quot;, its true nature being the figure of an abnormally lovely maiden who can&#39;t help but stir up the desire in men to protect her\u2015\u2015\u2015\u2015\u2015is how it used to be.</p><p>Although it appears her adoration for ballet is due to that image, perhaps due to the influence of the skill that continues to steal the opponent&#39;s abilities, currently, her personality is quite belligerent.</p><p><strong>Sadistic Constitution A</strong></p><p>A Skill that provides a bonus correction to one&#39;s aggression during battle.</p><p>It seems like a positive Skill, but the longer its possessor stays in combat, the more their abusive disposition will grow, causing them to lose their usual composure.</p><p>It could be called a skill that causes one to rampage just one step short of becoming a Berserker.</p><p>One becomes stronger the more they attack, but on the other hand, their defensive power drops.</p><p>Since it also has the negative aspect of unconsciously lowering the possibility that the possessor would withdraw, you could say that it has a bad compatibility with the usually composed Meltryllis.</p><p><strong>Melt Virus EX</strong></p><p>The special powers possessed by the Alter Egos since birth called id_es.</p><p>The cheat skill evolved from \u300EAbsorption\u300F.</p><p>The highest grade of energy drain.</p><p>It makes draining, copying and scaling down possible.</p><p>The process of draining is:</p><ol><li><p>The virus produced inside Meltryllis&#39; body is injected into the target in the form of nectar (poison), melting the parameters stolen at that time, such as &quot;experience points&quot;, &quot;skills&quot; and &quot;capacity&quot;.</p></li><li><p>After that, she absorbs, converts and turns the parameters liquefied by her virus into a part of herself.</p></li></ol><p>Something like that.</p><p>If it possesses a shape, organic matter, inorganic substance, no matter what it might be, she can drain it, but if it&#39;s something shapeless...such things as a spiritual nature or skills, although they can be liquefied, converting them into &quot;something of her own&quot; is difficult so it seems like she can only use them as simple nutrients.</p><p>Due to this, &quot;experience points&quot; and &quot;capacity&quot; are the main things she can make &quot;her own&quot;.</p><p>In \u300ECCC\u300F, she managed to pull off a drastic move where she scaled down humans and Servants, shrinking them to minimum size and she sent them into the enemy&#39;s body as a virus.</p><p>In \u300EFateGO\u300F, making no distinction between friend or foe, it has the effect of reducing (draining) the power of Noble Phantasms while increasing the power of her own.</p><p><strong>Saint Graph Expansion B</strong></p><p>A skill similar but dissimilar to &quot;Shapeshift&quot;.</p><p>Meltryllis&#39; essence is water, and if she felt like it, she could behave like a fluid.</p><p>The mythological essences who became her foundation...the god of rivers and civilization, Saraswati; the great tidal wave swallowing cities, Leviathan; these two grant her a perfectly slipstream-like constitution.</p><h2 id="noble-phantasm-s" tabindex="-1"><a class="header-anchor" href="#noble-phantasm-s" aria-hidden="true">#</a> Noble Phantasm(s)</h2><h1 id="saraswati\u30FBmeltout-benzaiten-s-five-stringed-biwa-1" tabindex="-1"><a class="header-anchor" href="#saraswati\u30FBmeltout-benzaiten-s-five-stringed-biwa-1" aria-hidden="true">#</a> Saraswati\u30FBMeltout (Benzaiten&#39;s Five-Stringed Biwa)[1]</h1><ul><li>Rank: EX</li><li>Classification: Anti-Mind Noble Phantasm</li><li>Range: 20~500</li><li>Maximum number of target: 1000 people</li></ul><p>Saraswati\u30FBMeltout.</p><p>Originally, it&#39;s not an Anti-Mind, but an Anti-Populace, Anti-World Noble Phantasm.</p><p>Not meant for battle or against combatants, instead, it&#39;s to be used against a civilization that has established a standardized culture.</p><p>Not just the body, Meltryllis&#39; nectar sweetly dissolves one&#39;s mind too.</p><p>This Noble Phantasm melts the good sense and morals of the community, fusing them into a sort of colony.</p><p>Its original power is to trample and absorb the body, mind, and society that has been reduced to a slime-like state.</p><p>It displays an immense effect against non-combatants, revealing the malicious nature of Meltryllis and the others.</p><p>The one this Noble Phantasm&#39;s made up of is the goddess Benzaiten, one of the Seven Gods of Fortune, one regarded as the same as the three Munakata goddesses and Ugajin.[2]</p><p>It takes the form of Benzaiten&#39;s biwa, controlling &quot;things that flow&quot; like natural phenomena, water, and wind, in particular, music and words, language and poetry.</p><p>Benzaiten&#39;s origin is the river goddess from Hindu mythology, Saraswati.</p><p>She&#39;s a cowardly goddess when it comes to love; she was born from the creator god Brahma, however, she had to run for her life when she was unable to endure Brahma&#39;s passionate looks who, due to her overwhelming beauty, wished for her to become his spouse.</p><p>Saraswati is a goddess who governs arts and learning, and since being worshipped as Benzaiten, she gained the authority of increasing wealth too.</p><h1 id="this-love-grief-3-is-like-a-meteor-star" tabindex="-1"><a class="header-anchor" href="#this-love-grief-3-is-like-a-meteor-star" aria-hidden="true">#</a> This Love(Grief)[3] is Like a Meteor(Star)</h1><ul><li>Rank: EX</li><li>Type: Anti-World Noble Phantasm</li><li>Range: 10~1000</li><li>Max. Targets: a single individual</li></ul><p>Virgin Laser\u30FBPalladion.</p><p>The combined Noble Phantasm of Passionlip and Meltryllis, modeled after the goddess Athena&#39;s spear.</p><p>A super long-distance Noble Phantasm where Meltryllis - whose whole body&#39;s been turned into a Noble Phantasm by transforming into a liquid state - is fired as a projectile, using the space compressing ability of Passionlip&#39;s Trash &amp; Crash as a shooting device (catapult).</p><p>Palladion is the statue of the goddess Athena who protected the fortress city, Troy, in Greek mythology.</p><p>As long as this statue was there, Troy was impregnable, however, due to the schemes of the enemy army, the statue was stolen and Troy fell.</p><p>Palladion, mighty without equal as &quot;something that protects the city&quot;, was, in fact, something that served to indicate the city&#39;s fated destruction if it was to be lost.</p><h1 id="character" tabindex="-1"><a class="header-anchor" href="#character" aria-hidden="true">#</a> Character</h1><h2 id="pronouns" tabindex="-1"><a class="header-anchor" href="#pronouns" aria-hidden="true">#</a> Pronouns</h2><ul><li>First person pronoun: watashi</li><li>Second person pronoun: anata</li><li>Third person pronoun: him/her</li></ul><p>Generally, she refers to the Master by name without using an honorific. When serious: &quot;Master&quot;. When making fun of them: &quot;\u3007\u3007 Master-san?&quot;</p><h2 id="personality" tabindex="-1"><a class="header-anchor" href="#personality" aria-hidden="true">#</a> Personality</h2><p>Belligerent and ruthless. Moreover, a queen-like personality with sadistic tastes.</p><p>A fondness for structural beauty, and a fastidiousness that won&#39;t forgive unsightly things.</p><p>Since she is a flawless existence, her pride is high, self-confident that she can do everything by herself.</p><p>An ego created from BB&#39;s &quot;Altruism Desire&quot; and &quot;Pleasure&quot;.</p><p>Scorning humans, pessimistic about things, finding everything boring, she possesses a glum outlook like this, however, that is the opposite of her wish of &quot;wanting to see beautiful things&quot;.</p><p>Since Meltryllis is an Alter Ego born from the &quot;wish of a maiden&quot;, her foundation is the same as Passionlip&#39;s, wishing for a Prince Charming to come for her.</p><p>She is cold-hearted, but this is due to a thoughtful rationality,</p><p>She is merciless, but this is due to her ascertaining everything fairly,</p><p>She has sadistic tastes, but this is because she possesses the virtue of taking care of those she likes by earnestly meddling with them.</p><p>Since she is fully aware of being a monster, she does not believe she can come to a mutual understanding with humans.</p><p>She does not believe in that and behaves like a monster, but if she were to fall in love with somebody, with no concern for the fact that she is a monster, she will offer her services to them; a primadonna who lives for love.</p><p>\u25C7</p><p>Despite absorbing others, she does not wish for understanding and sympathy, after all, to Meltryllis, the feelings of others is something she does not understand.</p><p>To her, other people are unneeded. Loves and dreams can not coexist. In case such a girl were to possess love, she would offer everything up along with her services to the object of her love for sure.</p><p>To the self-sufficient Meltryllis, there is no merit in taking the feelings of the other party into consideration.</p><p>She declares her love as just with a high-handed attitude.</p><p>She has no intention to discuss,</p><pre><code>(she loves you so much that she no longer feels the need for something like that)  \n</code></pre><p>She has no desire to touch each other,</p><pre><code>	(she is no longer satisfied with pleasure of such magnitude)  \n</code></pre><p>She does not feel like informing you of her wish to be loved.</p><pre><code>		(Such mutual understanding is no longer necessary)  \n</code></pre><p>Truly a domineering ego with all sorts of no&#39;s.</p><p>Behind that always condescending, high-handed attitude, there&#39;s a resolute, unclouded and overly pure love.</p><p>\u25C7</p><p>After the events of \u300ECCC\u300F, Meltryllis realized it.</p><p>The incarnation of &quot;self pleasure&quot; that does not need others; the true foundation of such a self.</p><p>What lied at Meltryllis&#39; core was none other than the &quot;devotion to her loved one&quot;.</p><p>...Raising her levels with repeated drains, trying to control the Moon Cell, these are all offerings for her lover&#39;s supreme pleasure.</p><p>Protect lover -&gt; Absorb him -&gt; The absorbed him (even if he will change so much that he can&#39;t even comprehend) will live on forever.</p><p>She decided that this is the most supreme love that she can offer to her lover.</p><p>Seen from such a Meltryllis point of view, even BB and Lip are no more than &quot;Impurities who think they want to be saved too&quot;.</p><p>...However, that thought is way too dismissive.</p><p>For her, who only finds her own heart trustworthy and has a weak connection to the outside world, the act of &quot;falling in love with another person&quot; itself was a fatal defect (bug).</p><p>This became the cause of Meltryllis&#39; defeat, but the current her acknowledges this defect.</p><p>Her perfect self degraded to something imperfect.</p><p>Meltryllis is already aware that&#39;s a &quot;dream&quot; she, herself, has given birth to.</p><h2 id="attitude-towards-master" tabindex="-1"><a class="header-anchor" href="#attitude-towards-master" aria-hidden="true">#</a> Attitude Towards Master</h2><p>Although she revised her way of thinking, after the events of \u300ECCC\u300F, Meltryllis&#39; misanthropy remained the same as ever.</p><p>She&#39;ll lend her power to the Master that made a contract with her, but - &quot;To think I would serve something like a human!&quot; - she&#39;ll complain incessantly like so.</p><p>Nonetheless, after deepening their bonds, - &quot;...Well, you&#39;re better than other humans, you know.&quot; - she&#39;ll open her heart...maybe.</p><h2 id="dialogue-examples" tabindex="-1"><a class="header-anchor" href="#dialogue-examples" aria-hidden="true">#</a> Dialogue Examples</h2><ul><li><p>\u300CI only saved you on a whim. I see. You, you don&#39;t have a Servant, do you. Perfect. Wonderful. I too was searching for a convenient doll (master).\u300D</p></li><li><p>\u300CI&#39;ll save you from that woman. In exchange, form a contract with me. No, you must form one with me. After all, if you don&#39;t, you&#39;ll be dying here. \u2015\u2015\u2015\u2015Look. There is no time. I won&#39;t say it again so listen close. I am the Alter Ego of Pleasure, Meltryllis. Since I feel like it, I&#39;ll become your sword. Therefore\u2015\u2015\u2015\u2015\u300D</p></li><li><p>\u300CNod (answer) like the slave you are, would you? You are my Master, after all.\u300D</p></li><li><p>\u300CAlter Egos were created in order to deny humanity. We are supposed to be your natural enemies, you see. The hunters, us, and the hunted, you. It&#39;s just a one-sided relationship like that.\u300D</p></li><li><p>\u300CYou are also an obstinate human, aren&#39;t you. Are you not afraid of me? Spiked feet with heels made of blades and poison that melts all that it touches. Other than my suppressive power as a weapon, there is nothing else you want from me, no?\u300D</p></li><li><p>\u300CI am just an Alter Ego for him/her. That&#39;s fine. That is fine. After all, originally, we were beings who have never met.\u300D</p></li><li><p>\u300CI did not fight because I wanted to love. \u2015\u2015\u2015\u2015I flew away from the lake so I could fall in love.\u300D</p></li></ul><h2 id="character-in-fgo" tabindex="-1"><a class="header-anchor" href="#character-in-fgo" aria-hidden="true">#</a> Character in FGO</h2><p>The Alter Ego of Pleasure.</p><p>The familiars created by BB by removing her personality (emotions).</p><p>Since they are not &quot;copies of her personality&quot;, but were &quot;created from the foundation of her personality&quot;, instead of avatars they became alter egos (different personalities). With her drain function, a top class synthesizing ability even among the Alter Egos BB produced, Melt surpassed even her creator (BB).</p><p>Possessing the nature of a liquid, she&#39;s the perfect fluid concealing the possibility to become the very ocean itself as she develops within herself.</p><p>...However, somehow she ended up adoring classical ballet, and started fussing about having human limbs. Because she is aware of being a perfected individual, she has an enormous amount of pride, and she&#39;s also aggressive to boot.</p><p>&quot;My constitution is as sadistic as I thought.</p><p>Being able to thoroughly kick the hated enemies to death is honestly out of this world.&quot;</p><p>Meltryllis is exactly like a Queen of Water, however, her body can not deviate from the figure of a young girl which is more delicate and pitiful than any other Ego&#39;s.</p><h2 id="neurological-disorder" tabindex="-1"><a class="header-anchor" href="#neurological-disorder" aria-hidden="true">#</a> Neurological Disorder</h2><p>The outside world is perceived with the five senses\u2015\u2015\u2015\u2015the five sensors of sight, hearing, smell, taste and touch, and with these echoes, one can also perceive their own self.</p><p>In general, humans come in contact with the world via their passive sensitivity.</p><p>Using the outstanding sensors called the five senses subconsciously, they receive things every day.</p><p>However, if any of the five senses&#39; ability deteriorates, the consciousness must aggressively face the world. What was passive becomes active.</p><p>For example, those who lost the light of their eyes specialize the remaining four and use them as even greater sensors. Ironically, they will function several times sharper than the senses of the human who still have all five.</p><p>Among Meltryllis&#39; five senses, her sense of touch has deteriorated.</p><p>Especially the sensation of her hands\u2015\u2015\u2015\u2015of her fingertips is almost completely lost. Due to this, her connection to the outside world has turned aggressive.</p><p>It seems like even her sadistic constitution, when you get right down to it is, is the result of &quot;because she alone can not sense others&#39; existence&quot;.</p><p>Incidentally, this is the reason she has clumsy fingers and why she can&#39;t immerse herself in her hobby of making dolls, assembling them out of garage kits. Now hiring skilled builders!</p><h2 id="related-characters" tabindex="-1"><a class="header-anchor" href="#related-characters" aria-hidden="true">#</a> Related Characters</h2><p><strong>BB</strong></p><p>It&#39;s not like I have a hard time dealing with her, but I don&#39;t like her either, the Original. She displays an unbelievably disgraceful behavior from time to time, giving even me a headache during those times.</p><p>Since it&#39;s obvious that she&#39;ll become a hindrance eventually, if I have an opportunity and a motive, I&#39;d like to stab her in the back, you see?</p><p><strong>Passionlip</strong></p><p>Didn&#39;t she become better than before?</p><p>She was the most childish one among us, but that part of her also left her ample room to mature.</p><p>However, even if it&#39;s me, I can&#39;t cover for her when it comes to those hands.</p><p><strong>Sesshouin Kiara</strong></p><p>Greed and vitiation, in this manner, she is the personification of a pure &quot;woman&quot;.</p><p>My love was for my own satisfaction too, but it&#39;s my loss when it comes to that woman.</p><p>Actually, I don&#39;t want to be put in the same category as her!</p><p><strong>Tristan</strong></p><p>The perfect example for a man who can be considered attractive if he just keeps quiet and we&#39;re only talking about his appearance.</p><p>...Well, the contents are relatively attractive too, but...why is it that he becomes so deplorable when he starts talking, I wonder...</p><p><strong>Artemis</strong></p><p>It&#39;s strange... Cold like ice and an efficiently stream-lined body shape; that&#39;s the feeling one should get when speaking of Artemis...</p><p>Is that, by any chance, an Avatar?</p><p><strong>Osakabehime</strong></p><p>I sympathize with her. As a collector who does not create.</p><p>Should I steal a glance at her net purchase history next time, I wonder...</p><p><strong>Emiya</strong></p><p>When I see that face, I get irritated for some reason. Awfully irritated!</p><h2 id="comment-from-the-illustrator" tabindex="-1"><a class="header-anchor" href="#comment-from-the-illustrator" aria-hidden="true">#</a> Comment from the Illustrator</h2><p>I gave her a head and body. Then she was given a metal bikini that&#39;s no good in various ways to cover her private parts. Putting a doll-like pure white dress on Melt who loves dolls was satisfying~! I am glad I could draw my dearest wish, Melt&#39;s butt, in her final ascension since I thought there would be no opportunity to draw it again. (Wada Arco)</p><h1 id="translation-notes" tabindex="-1"><a class="header-anchor" href="#translation-notes" aria-hidden="true">#</a> Translation Notes:</h1><p>[1] Benzaiten is the Japanese name for the Hindu goddess Saraswati (one of the goddesses making up Melt). The biwa is a Japanese short-necked fretted lute, often used in narrative storytelling.</p><p>[2] A god of harvests and wealth (syncretized with Saraswati, and often taking the form of a heavenly woman, a white snake or a fox).</p><p>[3] The word used here is &quot;\u611B\u697D&quot; which is a Buddhist term &quot;seeking after (Buddhist teachings, etc.), wanting, desiring&quot; or an archaic way to say &quot;loving&quot;</p><h2 id="material-images" tabindex="-1"><a class="header-anchor" href="#material-images" aria-hidden="true">#</a> Material Images</h2><p><img src="https://github.com/Assets-I/Materials/blob/main/fgo-material-V/i-118.jpg?raw=true" alt=""></p><p><img src="https://github.com/Assets-I/Materials/blob/main/fgo-material-V/i-118.jpg?raw=true" alt=""></p><p><img src="https://github.com/Assets-I/Materials/blob/main/fgo-material-V/i-120.jpg?raw=true" alt=""></p><p><img src="https://github.com/Assets-I/Materials/blob/main/fgo-material-V/i-121.jpg?raw=true" alt=""></p><p><img src="https://github.com/Assets-I/Materials/blob/main/fgo-material-V/i-122.jpg?raw=true" alt=""></p><p><img src="https://github.com/Assets-I/Materials/blob/main/fgo-material-V/i-123.jpg?raw=true" alt=""></p><p><img src="https://github.com/Assets-I/Materials/blob/main/fgo-material-V/i-124.jpg?raw=true" alt=""></p><p><img src="https://github.com/Assets-I/Materials/blob/main/fgo-material-V/i-125.jpg?raw=true" alt=""></p><p><img src="https://github.com/Assets-I/Materials/blob/main/fgo-material-V/i-126.jpg?raw=true" alt=""></p><p><img src="https://github.com/Assets-I/Materials/blob/main/fgo-material-V/i-127.jpg?raw=true" alt=""></p><p><img src="https://github.com/Assets-I/Materials/blob/main/fgo-material-V/i-128.jpg?raw=true" alt=""></p><p><img src="https://github.com/Assets-I/Materials/blob/main/fgo-material-V/i-129.jpg?raw=true" alt=""></p><h2 id="dialogue" tabindex="-1"><a class="header-anchor" href="#dialogue" aria-hidden="true">#</a> Dialogue</h2><table><thead><tr><th style="text-align:left;">Occassion</th><th style="text-align:center;">English</th><th style="text-align:center;">Japanese</th></tr></thead><tbody><tr><td style="text-align:left;">Summoned</td><td style="text-align:center;"></td><td style="text-align:center;"></td></tr></tbody></table>', 187);
